import React, {Component} from 'react';
import {inject, observer} from "mobx-react";
import './board.scss';


@inject('stores')
@observer
class Home extends Component {

    componentDidMount() {
        this.props.stores.postStore.fetchItems();
    }

    render() {

        let p = this.props.stores.postStore;

    }
}

export default Home;
